    def doLogin(self):
        global conn
        global client

        userInput = self.loginUserLineEdit.text().lower()
        passInput = self.loginPassLineEdit.text().lower()

        query = api.get_users(conn, "pass", "name", f"'{userInput}'")

        if query == "f":
            self.displayPopup("El nombre de usuario es incorrecto.")
        else:
            if query != passInput:
                self.displayPopup("La contraseña es incorrecta.")
            else:
                previous = api.get_users(conn, "connections", "name", f"'{userInput}'")
                api.put_users(conn, "connections", "name", f"'{userInput}'", previous + 1)

                client = userInput
                self.setSidebarState(True)
                self.changePage(MainWindow, 1)


    def doRegister(self):
        global conn
        global client

        userInput = self.loginUserLineEdit.text().lower()
        passInput = self.loginPassLineEdit.text().lower()

        if userInput == "" or passInput == "":
            self.displayPopup("Debes rellenar todos los espacios para crear una cuenta.")
        else:
            repeat = api.get_users(conn, "id", "name", f"'{userInput}'")

            if repeat == "f":
                newid = api.get_global(conn, "next_id", "'user'")
                api.put_global(conn, "next_id", "'user'", newid + 1)

                api.post_users(conn=conn,
                    user_id=int(newid),
                    user_name=userInput,
                    user_pass=passInput,
                    user_color="blue",
                    user_day1="'{}'",
                    user_day2="'{}'",
                    user_day3="'{}'",
                    user_day4="'{}'",
                    user_day5="'{}'",
                    user_day6="'{}'",
                    user_day7="'{}'", 
                    user_friends="'{}'",
                    user_requests="'{}'",
                    user_connections=1,
                    user_classes="'{{"'global'", "'N/a'", "'N/a'", "'N/a'", "'0'", "'0'", "'0'", "'N/a No hay datos'", "'N/a No hay datos'", "'N/a No hay datos'", "'N/a No hay datos'"}}'"                                       
                )

                client = userInput
                self.setSidebarState(True)
                self.changePage(MainWindow, 1)

            else:
                self.displayPopup(f"El nombre {userInput} ya está en uso.")


    @bp.profile
    def changePage(self, MainWindow, index: int, sidebar_placed=False):
        global sidebar
        global visit
        global current_index

        if sidebar_placed == True:
            if sidebar == True:
                current_index = index
                self.retranslateUi(MainWindow)
                self.stackedWidget.setCurrentIndex(index)
        else:
            if index == 5:
                if visit != "None":
                    current_index = index
                    self.retranslateUi(MainWindow)
                    self.stackedWidget.setCurrentIndex(index)
                else:
                    self.displayPopup("Haz doble click sobre un nombre de usuario para seleccionarlo y visitar su perfíl.")
            else:
                current_index = index
                self.retranslateUi(MainWindow)
                self.stackedWidget.setCurrentIndex(index)


    # Búsqueda functions
    def searchUser(self):
        global conn
        global client
        global visit

        visit = "None"
        self.busquedaResultsList.clear()

        text = self.busquedaSearchLineEdit.text().lower()
        all_users = api.get_users_column(conn, "name")

        if all_users != "f":
            match = []
            for i in all_users:
                for j in i:
                    length = len(text)
                    if j[:length] == text and j != client:
                        match.append(j)

            self.busquedaResultsList.addItems(match)


    def busquedaResultsListEvent(self, item):
        global visit
        visit = item.text()
